function ode_system2!(du, u, p, t)
        Xv, Xt, GLC, GLN, LAC, AMM, MAb, P1_1, P2_1, P3_1, P4_1, P5_1, P6_1, P7_1, P1_2, P2_2, P3_2, P4_2, P5_2, P6_2, P7_2, P1_3, P2_3, P3_3, P4_3, P5_3, P6_3, P7_3, P1_4, P2_4, P3_4, P4_4, P5_4, P6_4, P7_4, P1_5, P2_5, P3_5, P4_5, P5_5, P6_5, P7_5, P1_6, P2_6, P3_6, P4_6, P5_6, P6_6, P7_6, P1_7, P2_7, P3_7, P4_7, P5_7, P6_7, P7_7  = u;
        # Q1_1, Q2_2,Q3_3,Q4_4,Q5_5, Q6_6, Q7_7 = p;
        # mu_max= 5.8e-2;
        # Kglc= 0.75;
        # Kgln= 0.075;
        # KIlac= 171.756;
        # KIamm= 28.484;
        # mu_dmax= 3e-2;
        # Kdamm= 1.76;
        # Klysis= 0.05511;
        # Yxglc= 1.061e8;
        # mglc= 4.853e-14;
        # Yxgln= 5.57e8;
        # alpha1= 3.4e-13;
        # alpha2= 4;
        # Kdgln= 9.6e-3;
        # Ylacglc= 1.399;
        # Yammgln= 4.27e-1;
        # r1= 0.1;
        # r2= 2;
        # lambda= 7.21e-9;

        Q1_1, Q2_2,Q3_3,Q4_4,Q5_5, Q6_6, Q7_7,mu_max, Kglc, Kgln, KIlac, KIamm, mu_dmax, Kdamm, Klysis, Yxglc, mglc, Yxgln, alpha1, alpha2 ,Kdgln, Ylacglc, Yammgln, r1, r2, lambda = p;


        du[1]=(-Xv*mu_dmax) / (1 + (Kdamm / AMM)^2) + (GLC*GLN*KIamm*KIlac*Xv*mu_max) / ((AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC));
        du[2]=(GLC*GLN*KIamm*KIlac*Xv*mu_max) / ((AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC)) - Klysis*(Xt - Xv);
        du[3]=Xv*((-GLC*GLN*KIamm*KIlac*mu_max) / (Yxglc*(AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC)) - mglc);
        du[4]=Xv*((-GLN*alpha1) / (GLN + alpha2) + (-GLC*GLN*KIamm*KIlac*mu_max) / (Yxgln*(AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC))) - GLN*Kdgln;
        du[5]=Xv*Ylacglc*(mglc + (GLC*GLN*KIamm*KIlac*mu_max) / (Yxglc*(AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC)));
        du[6]=GLN*Kdgln + Xv*Yammgln*((GLN*alpha1) / (GLN + alpha2) + (GLC*GLN*KIamm*KIlac*mu_max) / (Yxgln*(AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC)));
        du[7]=Xv*lambda*(r2 + (-GLC*GLN*KIamm*KIlac*mu_max*r1) / ((AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC)));
        du[8]=Q1_1 + P1_3*((GLN*KIamm*KIlac*Xv*mu_max) / ((AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC)) - (AMM + KIamm)*(GLN + Kgln)*(KIlac + LAC)*((GLC*GLN*KIamm*KIlac*Xv*mu_max) / (((AMM + KIamm)^2)*((GLC + Kglc)^2)*((GLN + Kgln)^2)*((KIlac + LAC)^2)))) + P1_4*((GLC*KIamm*KIlac*Xv*mu_max) / ((AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC)) - (AMM + KIamm)*(GLC + Kglc)*(KIlac + LAC)*((GLC*GLN*KIamm*KIlac*Xv*mu_max) / (((AMM + KIamm)^2)*((GLC + Kglc)^2)*((GLN + Kgln)^2)*((KIlac + LAC)^2)))) + P4_1*((GLC*KIamm*KIlac*Xv*mu_max) / ((AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC)) - (AMM + KIamm)*(GLC + Kglc)*(KIlac + LAC)*((GLC*GLN*KIamm*KIlac*Xv*mu_max) / (((AMM + KIamm)^2)*((GLC + Kglc)^2)*((GLN + Kgln)^2)*((KIlac + LAC)^2)))) + P3_1*((GLN*KIamm*KIlac*Xv*mu_max) / ((AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC)) - (AMM + KIamm)*(GLN + Kgln)*(KIlac + LAC)*((GLC*GLN*KIamm*KIlac*Xv*mu_max) / (((AMM + KIamm)^2)*((GLC + Kglc)^2)*((GLN + Kgln)^2)*((KIlac + LAC)^2)))) + P1_6*((2Kdamm*(Kdamm / (AMM^2))*((-Xv*mu_dmax) / ((1 + (Kdamm / AMM)^2)^2))) / AMM - (GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC)*((GLC*GLN*KIamm*KIlac*Xv*mu_max) / (((AMM + KIamm)^2)*((GLC + Kglc)^2)*((GLN + Kgln)^2)*((KIlac + LAC)^2)))) + P6_1*((2Kdamm*(Kdamm / (AMM^2))*((-Xv*mu_dmax) / ((1 + (Kdamm / AMM)^2)^2))) / AMM - (GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC)*((GLC*GLN*KIamm*KIlac*Xv*mu_max) / (((AMM + KIamm)^2)*((GLC + Kglc)^2)*((GLN + Kgln)^2)*((KIlac + LAC)^2)))) + 2P1_1*((-mu_dmax) / (1 + (Kdamm / AMM)^2) + (GLC*GLN*KIamm*KIlac*mu_max) / ((AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC))) - P1_5*(AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*((GLC*GLN*KIamm*KIlac*Xv*mu_max) / (((AMM + KIamm)^2)*((GLC + Kglc)^2)*((GLN + Kgln)^2)*((KIlac + LAC)^2))) - P5_1*(AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*((GLC*GLN*KIamm*KIlac*Xv*mu_max) / (((AMM + KIamm)^2)*((GLC + Kglc)^2)*((GLN + Kgln)^2)*((KIlac + LAC)^2)));
        du[9]=P1_1*(Klysis + (GLC*GLN*KIamm*KIlac*mu_max) / ((AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC))) + P2_1*((-mu_dmax) / (1 + (Kdamm / AMM)^2) + (GLC*GLN*KIamm*KIlac*mu_max) / ((AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC))) + P2_4*((GLC*KIamm*KIlac*Xv*mu_max) / ((AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC)) - (AMM + KIamm)*(GLC + Kglc)*(KIlac + LAC)*((GLC*GLN*KIamm*KIlac*Xv*mu_max) / (((AMM + KIamm)^2)*((GLC + Kglc)^2)*((GLN + Kgln)^2)*((KIlac + LAC)^2)))) + P2_3*((GLN*KIamm*KIlac*Xv*mu_max) / ((AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC)) - (AMM + KIamm)*(GLN + Kgln)*(KIlac + LAC)*((GLC*GLN*KIamm*KIlac*Xv*mu_max) / (((AMM + KIamm)^2)*((GLC + Kglc)^2)*((GLN + Kgln)^2)*((KIlac + LAC)^2)))) + P3_1*((GLN*KIamm*KIlac*Xv*mu_max) / ((AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC)) - (AMM + KIamm)*(GLN + Kgln)*(KIlac + LAC)*((GLC*GLN*KIamm*KIlac*Xv*mu_max) / (((AMM + KIamm)^2)*((GLC + Kglc)^2)*((GLN + Kgln)^2)*((KIlac + LAC)^2)))) + P2_6*((2Kdamm*(Kdamm / (AMM^2))*((-Xv*mu_dmax) / ((1 + (Kdamm / AMM)^2)^2))) / AMM - (GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC)*((GLC*GLN*KIamm*KIlac*Xv*mu_max) / (((AMM + KIamm)^2)*((GLC + Kglc)^2)*((GLN + Kgln)^2)*((KIlac + LAC)^2)))) + P4_1*((GLC*KIamm*KIlac*Xv*mu_max) / ((AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC)) - (AMM + KIamm)*(GLC + Kglc)*(KIlac + LAC)*((GLC*GLN*KIamm*KIlac*Xv*mu_max) / (((AMM + KIamm)^2)*((GLC + Kglc)^2)*((GLN + Kgln)^2)*((KIlac + LAC)^2)))) - Klysis*P2_1 - P2_5*(AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*((GLC*GLN*KIamm*KIlac*Xv*mu_max) / (((AMM + KIamm)^2)*((GLC + Kglc)^2)*((GLN + Kgln)^2)*((KIlac + LAC)^2))) - P5_1*(AMM + KIamm)*(GLC + Kglc)*(GLN + Kgln)*((GLC*GLN*KIamm*KIlac*Xv*mu_max) / (((AMM + KIamm)^2)*((GLC + Kglc)^2)*((GLN + Kgln)^2)*((KIlac + LAC)^2))) - P6_1*(GLC + Kglc)*(GLN + Kgln)*(KIlac + LAC)*((GLC*GLN*KIamm*KIlac*Xv*mu_max) / (((AMM + KIamm)^2)*((GLC + Kglc)^2)*((GLN + Kgln)^2)*((KIlac + LAC)^2)));
