    params_mcmc=[(R)^2,Q1^2,Q2^2,Q3^2,Q4^2,Q5^2,Q6^2,Q7^2,mu_max, Kglc, Kgln, KIlac, KIamm, mu_dmax, Kdamm, Klysis, Yxglc, mglc, Yxgln, alpha1, alpha2 ,Kdgln, Ylacglc, Yammgln, r1, r2, lambda,u0_LAC,u0_MAb]

    obj = cost(params_mcmc)

    # Compute objective function
    # obj = cost([(R)^2,(Q1)^2,(Q2)^2,(Q3)^2,(Q4)^2,(Q5)^2,(Q6)^2,(Q7)^2])


    # Use the objective function as a likelihood
    obj ~ Normal(0, 1) # The exact form depends on how you interpret the objective function

end

